INSERT INTO `v1_416c5c6fedf2946956f7accf6eee1f458b75c8b46e17d3236b5cf92d07a10579` VALUES (0, 103311, 5, 1, "", 11, 1033501043, 1, 0, 1033501, "オラの食材とあんちゃんの腕……\nこれは二人の共同作業ってことに……\nな、なんでもねぇ！\n気にしねぇでけろ！");
INSERT INTO `v1_416c5c6fedf2946956f7accf6eee1f458b75c8b46e17d3236b5cf92d07a10579` VALUES ("", 0, "", "", "", 91, 1033501044, "", "", 1033501, "");
